import React from 'react';
import {SafeAreaView, Text, View} from "react-native";

const RegisterEventListScreen = () => {
  return (
    <SafeAreaView>
      <Text>EventList</Text>
    </SafeAreaView>
  );
};

export default RegisterEventListScreen;
